import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the search modal
    await page.click('button.close-modal'); // Assuming this opens the search modal
    await page.waitForSelector('#searchInput');

    // Take screenshot after opening the search modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal_opened.png'));

    // Click the remove button (×) on the first recent search item
    await page.waitForSelector('.search-item:first-child .remove-search');
    await page.click('.search-item:first-child .remove-search');

    // Take screenshot after removing the first recent search item
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_removed_first_recent_search.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_removed_first_recent_search.png'));

    return {
      success: true,
      action: "Removed the first recent search item from the search modal",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open search modal by clicking on the search input
    await page.waitForSelector('#mainSearchInput');
    await page.click('#mainSearchInput');

    // Wait for the search modal to be visible
    await page.waitForSelector('.search-modal');

    // Take screenshot of the search modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_modal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_modal.png'));

    // Click the remove button (×) on the first recent search item
    await page.waitForSelector('.search-item:first-child .remove-search', { state: 'visible' });
    await page.click('.search-item:first-child .remove-search');

    // Verify that the first recent search item is removed
    const isRemoved = await page.evaluate(() => {
      const firstItem = document.querySelector('.search-item');
      return firstItem === null;
    });

    // Take final screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_after_removal.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_after_removal.png'));

    return {
      success: true,
      action: "Removed the first recent search item from the search modal",
      extractedData: { isRemoved },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

